## 
### CREATE FONCTION FOR DATA
CREATE DEFINER=`root`@`localhost` FUNCTION `AddAnalyseData`(ad_point varchar(45), ad_type varchar(45), ad_value double, ad_sampler varchar(45), ad_validate boolean, ad_sampleTime varchar(45)) RETURNS INTEGER 
BEGIN    
    DECLARE result			text;
    DECLARE aa_enlimitHH	boolean;
    DECLARE aa_enlimitH		boolean;
    DECLARE aa_enlimitB		boolean;
    DECLARE aa_enlimitBB	boolean;
    DECLARE aa_limitHH		Double;
    DECLARE aa_limitH		Double;
    DECLARE aa_limitB		Double;
    DECLARE aa_limitBB		Double;
    


	## GET LAST ANALYSE DATA CORRESPONDING TO POINT AND TYPE
    SET aa_enlimitHH	= (SELECT analyse_allowed.aa_enlimitHH FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    SET aa_limitHH		= (SELECT analyse_allowed.aa_limitHH FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    
    SET aa_enlimitH		= (SELECT analyse_allowed.aa_enlimitH FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    SET aa_limitH		= (SELECT analyse_allowed.aa_limitH FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    
    SET aa_enlimitB		= (SELECT analyse_allowed.aa_enlimitB FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    SET aa_limitB		= (SELECT analyse_allowed.aa_limitB FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    
    SET aa_enlimitBB	= (SELECT analyse_allowed.aa_enlimitBB FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);
    SET aa_limitBB		= (SELECT analyse_allowed.aa_limitBB FROM ism.analyse_allowed where aa_point=ad_point and aa_type=ad_type order by aa_created DESC Limit 1);

	
	SET result = CONCAT("INSERT INTO `ism`.`analyse_data` (`ad_company`, `ad_point`, `ad_type`, `ad_value`, `ad_value_t`, `ad_sampler`, `ad_validate`, `ad_validator`,`ad_enlimitHH`, `ad_limitHH`, `ad_enlimitH`, `ad_limitH`, `ad_enlimitB`, `ad_limitB`, `ad_enlimitBB`, `ad_limitBB`, `ad_batch`, `ad_sampleTime`, `ad_observation`, `ad_deleted`, `ad_created`, `ad_changed`) VALUES (39, '",
				ad_point, "', '", ad_type, "',", ad_value, ", '-', '", ad_sampler, "', ", ad_validate, ", '60034',",
                aa_enlimitHH, ",", aa_limitHH, ",",
                aa_enlimitH, ",", aa_limitH, ",",
                aa_enlimitB, ",", aa_limitB, ",",
                aa_enlimitBB, ",", aa_limitBB, ",",
                "-,", ad_sampleTime, ",'-',0, NOW(), NOW());");

	
    VALUES ('39', ad_point, ad_type, ad_value, '-', ad_sampler, ad_validate, '60034', aa_enlimitHH, aa_limitHH, aa_enlimitH, aa_limitH, aa_enlimitB, aa_limitB, aa_enlimitBB, aa_limitBB, '0', ad_sampleTime, '-', 0, NOW(), NOW());

RETURN 1;
END