INSERT INTO ism.analyse_type(at_company, at_type, at_designation, at_unite, at_method, at_category, at_description, at_deleted, at_created, at_changed) VALUES (39, 'µS', 'MES. DE CONDUCTIVITE', 'µS/cm', 'UNDEF', 'UNDEF', 'Elle détermine l ensemble des els minéraux dissous dans une solution. Une eau douce a une valeur faible.', 0, NOW(), NOW());
INSERT INTO ism.analyse_type(at_company, at_type, at_designation, at_unite, at_method, at_category, at_description, at_deleted, at_created, at_changed) VALUES (39, 'TH', 'MES. TITRE HYDROMETRIQUE ', '°F', 'UNDEF', 'UNDEF', 'Le TH mesure la quantité de minéraux dissous (des sels de calcaire et de magnésium)', 0, NOW(), NOW());
INSERT INTO ism.analyse_type(at_company, at_type, at_designation, at_unite, at_method, at_category, at_description, at_deleted, at_created, at_changed) VALUES (39, 'TA', 'MES. TITRE ALCALIMETRIQUE', 'ppm', 'UNDEF', 'UNDEF', 'Le TA dose la totalité des hydroxydes et la moitié des carbonates qui sont alors entièrement ransformés en bicarbonates à un pH de 8,3. Par conséquent, il mesure la teneur en alcalis libre (OH-) et en carbonates (CO3)', 0, NOW(), NOW());
INSERT INTO ism.analyse_type(at_company, at_type, at_designation, at_unite, at_method, at_category, at_description, at_deleted, at_created, at_changed) VALUES (39, 'TAC', 'MES. TITRE ALACALIMETRIQUE COMPLET', 'mg/l', 'UNDEF', 'UNDEF', 'Le TAC correspond à la totalité des bicarbonates et des carbonates. Par conséquent, il mesure la somme des alcalis libres, des carbonates et des bicarbonates', 0, NOW(), NOW());
INSERT INTO ism.analyse_type(at_company, at_type, at_designation, at_unite, at_method, at_category, at_description, at_deleted, at_created, at_changed) VALUES (39, 'Cl2', 'MES. DU DICHLORE (CHLORINE)', 'mg/l', 'UNDEF', 'UNDEF', 'Le dichlore est un gaz jaune-vert dans les conditions normales de température et de pression.', 0, NOW(), NOW());
